import React from 'react';
import { UISref, UIRouter, UIView, pushStateLocationPlugin, servicesPlugin, UIRouterReact} from "@uirouter/react";

//OnsenUI
var Ons = require('onsenui');
var ROns = require('react-onsenui');

export default class extends React.Component {
    constructor(){
      super();
    }
  
    RenderMenu(){
        const refs = [
            <ROns.ListItem ><UISref key="main" to="app.main"><ROns.Button modifier="quiet"> Главная </ROns.Button></UISref></ROns.ListItem >,
            <ROns.ListItem ><UISref key="main" to="app.categories"><ROns.Button modifier="quiet"> категории </ROns.Button></UISref></ROns.ListItem >,
            <ROns.ListItem ><UISref key="main" to="app.settings"><ROns.Button modifier="quiet"> настройки </ROns.Button></UISref></ROns.ListItem >,
        ]

        return refs;
    }

    render(){
      return (
    <ROns.Splitter>
    <ROns.SplitterSide
      width={200}>
      <ROns.ListTitle>Меню</ROns.ListTitle>
   <ROns.List>
       {this.RenderMenu()}
   </ROns.List>
    </ROns.SplitterSide>

    <ROns.SplitterContent>
      <ROns.Page>
          <UIView />
      </ROns.Page>
    </ROns.SplitterContent>

    </ROns.Splitter>
      );
    }
  }
